import React from "react";
import { Form, Input, Select, Checkbox, Button } from "antd";

const { Options } = Select;

const AddUserForm = () => {
  const [form] = Form.useForm();

  const onFinish = () => {};
  return (
    <Form form={form} name="add user" onFinish={onFinish}>
      <Form.Item name="name" label="Name" style={{ width: "400px" }}>
        <Input />
      </Form.Item>
      <Form.Item name="address" label="Address" style={{ width: "400px" }}>
        <Input />
      </Form.Item>
    </Form>
  );
};

export default AddUserForm;
